import React, { useState } from "react";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import { LinkContainer } from "react-router-bootstrap";
import github from "../icons/github.svg";
import githubColor from "../icons/githubColor.svg";
import insta from "../icons/insta.svg";
import logo from "../images/LOGO.jpeg";
import instacolor from "../images/instagram.png";
function NavigationBar() {
const [icon1, seticon1] = useState(insta);
const [icon2, seticon2] = useState(github);

const handleInstaIconEnter = () => {
seticon1(instacolor);
};
const handleInstaIconLeave = () => {
seticon1(insta);
};
const handleGitIconEnter = () => {
seticon2(githubColor);
};
const handleGitIconLeave = () => {
seticon2(github);
};

return (
<div>
    <Navbar
    expand="lg"
    style={{ background: "black" }}
    variant="dark"
    className=""
    >
    <Container>
        <LinkContainer to="/Home">
        <Navbar.Brand>
            <img
            src={logo}
            width="30"
            height="30"
            className="d-inline-block align-top"
            alt="Logo"
            />{" "}
            codeVISTA
        </Navbar.Brand>
        </LinkContainer>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="me-auto">
            <LinkContainer to="/Home">
            <Nav.Link>Home</Nav.Link>
            </LinkContainer>
            <LinkContainer to="/Compiler">
            <Nav.Link>Compiler</Nav.Link>
            </LinkContainer>
            <LinkContainer to="/HackathonUser">
            <Nav.Link>Hackathon</Nav.Link>
            </LinkContainer>

            <LinkContainer to="/TechNewsUser">
            <Nav.Link>Tech news</Nav.Link>
            </LinkContainer>
        </Nav>
        </Navbar.Collapse>
        <Navbar.Collapse id="icons" style={{ justifyContent: "end" }}>
        <Nav style={{ gap: "1rem", alignItems: "center" }}>
            <a href="" target="blank">
            <img
                onMouseLeave={handleInstaIconLeave}
                onMouseEnter={handleInstaIconEnter}
                src={icon1}
                alt="Instagram"
            />
            </a>

            <a
            target="blank"
            href="https://github.com/iamabhishekagarwal/webDevProj-BIT.git"
            >
            <img
                onMouseLeave={handleGitIconLeave}
                onMouseEnter={handleGitIconEnter}
                src={icon2}
                alt="Github"
            />
            </a>
        </Nav>
        </Navbar.Collapse>
    </Container>
    </Navbar>
</div>
);
}

export default NavigationBar;
